(49,1,"2019-02-19 15:50:54","2019-02-19 15:50:54","\"<b>Something</b>\" is a song by the English rock band <a title=\"The Beatles\" href=\"https://en.wikipedia.org/wiki/The_Beatles\">the Beatles</a> from their 1969 album <i><a title=\"Abbey Road\" href=\"https://en.wikipedia.org/wiki/Abbey_Road\">Abbey Road</a></i>. It was written by <a title=\"George Harrison\" href=\"https://en.wikipedia.org/wiki/George_Harrison\">George Harrison</a>, the band\'s lead guitarist. Soon after the album\'s release, the song was issued as a single, coupled with \"<a title=\"Come Together\" href=\"https://en.wikipedia.org/wiki/Come_Together\">Come Together</a>\", making it the first Harrison composition to become a Beatles A-side. Its pairing with \"Come Together\" was also the first time in the United Kingdom that the Beatles issued a single containing tracks that were already available on an album. The single topped the <a title=\"Billboard Hot 100\" href=\"https://en.wikipedia.org/wiki/Billboard_Hot_100\"><i>Billboard</i> Hot 100</a> in the United States as well as charts in Australia, Canada, New Zealand and West Germany, and peaked at number 4 in the UK.","Math","","publish","closed","closed","","math","","","2019-02-19 15:50:54","2019-02-19 15:50:54","",0,"http://secondsite.local/?post_type=program&#038;p=49",0,"program","",0),
