(60,1,"2019-02-25 14:23:28","2019-02-25 14:23:28","<div class=\"examp emphasized\"><span class=\"eg\">There\'s something <a class=\"query\" title=\"sharp\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/sharp\">sharp</a> in my <a class=\"query\" title=\"shoe\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/shoe\">shoe</a>.</span></div>\r\n<div class=\"examp emphasized\"><span class=\"eg\">Something in the <a class=\"query\" title=\"cupboard\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/cupboard\">cupboard</a> <a class=\"query\" title=\"smells\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/smell\">smells</a> <a class=\"query\" title=\"weird\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/weird\">weird</a>.</span></div>\r\n<div class=\"examp emphasized\"><span class=\"eg\">We <a class=\"query\" title=\"thought\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/thought\">thought</a> there was something <b class=\"b\"><a class=\"query\" title=\"wrong\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/wrong\">wrong</a></b> because we hadn\'t <a class=\"query\" title=\"heard\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/hear\">heard</a> from you.</span></div>\r\n<div class=\"examp emphasized\"><span class=\"eg\">There\'s something <a class=\"query\" title=\"wrong\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/wrong\">wrong</a> with the <a class=\"query\" title=\"engine\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/engine\">engine</a> - it\'s making <a class=\"query\" title=\"strange\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/strange\">strange</a> <a class=\"query\" title=\"noises\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/noise\">noises</a>.</span></div>\r\n<div class=\"examp emphasized\"><span class=\"eg\">Something\'s <a class=\"query\" title=\"happened\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/happen\">happened</a> to <a class=\"query\" title=\"upset\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/upset\">upset</a> him but we don\'t <a class=\"query\" title=\"know\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/know\">know</a> what it is.</span></div>\r\n<div class=\"examp emphasized\"><span class=\"eg\">I <a class=\"query\" title=\"heard\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/hear\">heard</a> something <a class=\"query\" title=\"worrying\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/worrying\">worrying</a> at <a class=\"query\" title=\"work\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/work\">work</a> this <a class=\"query\" title=\"morning\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/morning\">morning</a>.</span></div>\r\n<div class=\"examp emphasized\"><span class=\"eg\">Is there something you\'d like to say?</span></div>\r\n<div class=\"examp emphasized\"><span class=\"eg\">Don\'t just <a class=\"query\" title=\"stand\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/stand\">stand</a> there, <b class=\"b\">do</b> something.</span></div>\r\n<div class=\"examp emphasized\"><span class=\"eg\">There\'s just something <a class=\"query\" title=\"strange\" href=\"https://dictionary.cambridge.org/pl/dictionary/english/strange\">strange</a> about him.</span></div>\r\n&nbsp;","Dr. Naruto","","publish","closed","closed","","dr-naruto","","","2019-02-25 20:26:47","2019-02-25 20:26:47","",0,"http://secondsite.local/?post_type=professor&#038;p=60",0,"professor","",0),
